import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"

class Info extends React.Component {
    constructor(props){
      super(props)
    }
    render() {
        if(this.props.cities.length > 2)
            return(
                <TemperatureGraph
                    cities={this.props.cities}
                    temperatures={this.state.temperatures}
            dawn={this.state.dawn}
            dusk={this.state.dusk}
                />
            )
        else {
            return null
        }
    }
}
export default Info
